Application.ScrollMagic.Scenes.Prices=function(){const TIMELINE=new TimelineMax;for(const[index,element]of Object.entries(document.querySelectorAll(".price-card")))TIMELINE.fromTo(element,.4,{opacity:.05,scale:.95},{opacity:1,scale:1},index/2);return Application.Layout.set("Prices",new ScrollMagic.Scene({triggerElement:"#scene-prices",triggerHook:.6,duration:"80%"}).setTween(TIMELINE).addTo(Application.ScrollMagic.Controllers.Main)),!0};